export class Purchase {
  constructor(productId, quantity) {
    this.productId = productId;
    this.quantity = quantity;
  }

  getProductId() {
    return this.productId;
  }

  getQuantity() {
    return this.quantity;
  }

  setQuantity(quantity) {
    this.quantity = quantity;
  }

  getId() {
    return this.id;
  }

  setId(id) {
    this.id = id;
  }

}
